"""

Returns a list of positions, sorted in decreasing order of dissatisfaction,
for each student in the queue.

a_i and b_i are the characteristic of the student, initially on the position i.

n is the number of students in the queue.

"""

temp = []

for i in range(1, n+1):

temp.append(i)

a_i = 0

for j in range(1, n+1):

if j-1<=i and j+1<n:

b_i = b_i + 1

else:

b_i = b_i + (j-1)

a_i = a_i + b_i

if a_i >n:

temp.append(i)

return temp

