x = 0

for y in range(1, n + 1):

for z in range(1, m + 1):

if z == y and x == p - 1:

x = x + 1

if z == y and x != p:

x = findMinObstacle(n, m, p - 1)

if z == y:

x = 0

if z != m:

x = findMinObstacle(n, m, p)

