# Python code to calculate the escalator load factor 

def escalator_load_factor(n, p, t):

# Given n, p, and t, determine the number of people who will be on the escalator

# after t seconds

people = []

for i in range(1, n):

if i == 1:

people.append(1)

elif i == n - 1:

people.append(0)

else:

# If the person is standing in the first position, they will enter the escalator

if p == 1:

people.append(i)

else:

# If the person is not in the first position, they will not move and the whole queue will wait

# behind them

if not p(i):

people.append(i - 1)

else:

# If the person is in the first position and someone else enters the escalator, the person will leave the escalator

if p(i):

people.append(i + 1)

return people

